import React from "react";
import styled from "styled-components";
import PropTypes from "prop-types";


const Container = styled.div`
  width: 100%;
  height: 100%;
  background-color: red;
  display: flex;
  flex-direction: column;
`;

const Cover = styled.img`
  width: 100%;
  height: 100%;
  src: url(${(props) => props.bgImage});
  background-position: center center;
  background-size: cover;
  border-radius: 5px;
  position: relative;
`;

const DefaultButton = styled.button`
  width: 70%;
  height: 10%;
  background-color: red;
  position: absolute;
  left: 15%;
`

const HomePresenter = ({max_images}) => (
  <Container>
    {
      max_images.map( image => 
         { if (image === "1.png") {
           const Block = 
           <>
            <Cover key={image} src={require(`../../Assets/Block_Images/${image}`)} />
            <DefaultButton>asdfadfs</DefaultButton>
           </>
           return Block
         }
         else {
          return <Cover key={image} src={require(`../../Assets/Block_Images/${image}`)} />
         }}

      )
    }
  </Container>
);

HomePresenter.propTypes = {
  max_images: PropTypes.array
};


export default HomePresenter;
